import React, { useState } from 'react';
//import { Link } from 'react-router-dom';
import '../styles/Auth.css';

function Signup() {
  const [nom, setNom] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [age, setAge] = useState('');
  const [genre, setGenre] = useState('');
  const [type, setType] = useState('');
  const [photo, setPhoto] = useState(null);


const handleFileChange = (e) => {
  setPhoto(e.target.files[0]); // Récupère le fichier sélectionné
};

const handleSubmit = async (e) => {
  e.preventDefault();

  // Créer une instance de FormData
  const formData = new FormData();
  formData.append('nom', nom);
  formData.append('email', email);
  formData.append('password', password);
  formData.append('age', age);
  formData.append('genre', genre);
  formData.append('type', type);

  // Si une photo est sélectionnée, l'ajouter aussi au FormData
  if (photo) {
    formData.append('photo', photo); // "photo" doit correspondre au nom du champ dans PHP
  }

  // Envoi des données via fetch
  try {
    const response = await fetch('http://localhost:8000/Signup.php', {
      method: 'POST',
      body: formData, // Envoie formData directement
    });

    const data = await response.text();
    alert(data); // Affiche la réponse du serveur
  } catch (error) {
    console.error('Erreur:', error);
  }
};
  return (
    <form onSubmit={handleSubmit}>
      <label>
        Nom :
        <input type="text" value={nom} onChange={(e) => setNom(e.target.value)} />
      </label>
      <br />
      <label>
        Email :
        <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
      </label>
      <br />
      <label>
        Mot de passe :
        <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
      </label>
      <br />
      <label>
        Âge :
        <input type="number" value={age} onChange={(e) => setAge(e.target.value)} />
      </label>
      <br />
      <label>
        Genre :
        <select value={genre} onChange={(e) => setGenre(e.target.value)}>
          <option value="homme">Homme</option>
          <option value="femme">Femme</option>
          <option value="autre">Autre</option>
        </select>
      </label>
      <br />
      <label>
        Type de membre :
        <select value={type} onChange={(e) => setType(e.target.value)}>
          <option value="mère">Mère</option>
          <option value="père">Père</option>
          <option value="enfant">Enfant (maison)</option>
          <option value="élève">Élève (école/crèche)</option>
          <option value="maîtresse">Maîtresse (école/crèche)</option>
          <option value="directrice">Directrice (école/crèche)</option>
          <option value="développeur">Développeur (entreprise)</option>
          <option value="testeur">Testeur (entreprise)</option>
          <option value="chef_de_projet">Chef de projet (entreprise)</option>
          <option value="directeur">Directeur (entreprise)</option>
        </select>
      </label>
      <br />
      <label>
        Photo :  
      {/* Sélection de la photo */}
      <input type="file" accept="image/*" onChange={handleFileChange} />
      </label>

      <br />
      <button type="submit">Envoyer</button>
    </form>
  );
}

export default Signup;
